struct Nucleotide {
    char value;
    Nucleotide* next;
    Nucleotide* prev;
    Nucleotide* across;
};

char complementOf(char base) {
    if (base == 'A') return 'T';
    if (base == 'C') return 'G';
    if (base == 'G') return 'C';
    if (base == 'T') return 'A';
    error("Unknown nucleotide.");
}

void addComplementaryStrand(Nucleotide* dna) {
    while (dna != nullptr) {
        char complementBase = complementOf(dna->value);
        Nucleotide* complementDna = new Nucleotide;
        dna->across = complementDna;
        complementDna->value = complementBase;
        complementDna->across = dna;

        // If it's the first nucleotide
        if (dna->prev == nullptr) {
            complementDna->prev = nullptr;
        } else {
            complementDna->prev = dna->prev->across;
            dna->prev->across = complementDna;
        }
        // if it's last nucleotide
        if (dna->next == nullptr) {
            complementDna->next = nullptr;
        }
        dna = dna->next;
    }
}

string fromDNA(Nucleotide* dna) {
    string DNAstring;
    while (dna != nullptr) {
        DNAstring += dna->value;
        dna = dna->across;
    }
    return DNAstring;
}

int main() {
    Nucleotide* one   = new Nucleotide;
    Nucleotide* two   = new Nucleotide;
    Nucleotide* three = new Nucleotide;
    Nucleotide* four  = new Nucleotide;

    one->prev    = nullptr;
