}

struct Node {
    int value;
    Node* left;
    Node* right;
};

void printTree(Node* root) {
    /* Base case: Empty tree has nothing to print. */
    if (root == nullptr) return;

    /* Otherwise, print things in sorted order! To do that, we need to
     *
     *   1. print the smaller elements in sorted order,
     *   2. then print our value,
     *   3. then print the larger values in sorted order.
     */
    printTree(root->left);
    cout << root->value << endl;
    printTree(root->right);
}

void inflateRec(Node*& root, int sum, Node* parent) {
    if (root == nullptr) {

        parent->right = new Node;
        parent->left = new Node;

        parent->left->value = sum;
        parent->right->value = sum;

    } else {
        // Recursive Case
        int value = root->value;
        inflateRec(root->left, sum + value, root);
        inflateRec(root->right, sum + value, root);
    }
}

